    <div id="instructions">
        操作说明：<br>
        W / ↑: 向上移动<br>
        S / ↓: 向下移动<br>
        滚轮: 上下移动<br>
        <span id="windowWidth">0</span>.<span id="windowHeight">0</span>
    </div>
    <script>
        const image = document.getElementById('image');
        const windowWidthSpan = document.getElementById('windowWidth');
        const windowHeightSpan = document.getElementById('windowHeight');
        const baseHeight = 950;
        let scaleFactor = window.innerHeight / baseHeight; // 根据当前窗口高度计算放大倍数
        let step = 420; // 基准步长
        let posX = 0, posY = 0; // 初始坐标居中

        function updateTransform() {
            image.style.transform = `scale(${scaleFactor}) translate(${posX}px, ${posY+100}px)`;
        }

        function updateWindowDimensions() {
            windowWidthSpan.textContent = window.innerWidth;
            windowHeightSpan.textContent = window.innerHeight;
        }

        image.addEventListener('load', () => {
            updateTransform();
            updateWindowDimensions();
        });

        window.addEventListener('resize', () => {
            scaleFactor = window.innerHeight / baseHeight; // 更新放大倍数
            updateTransform();
            updateWindowDimensions();
        });

        document.addEventListener('keydown', (event) => {
            switch(event.key) {
                case 'w':
                case 'ArrowUp':
                    if (posY < step)
                    posY += step;
                    break;
                case 's':
                case 'ArrowDown':
                    if (posY > -step)
                    posY -= step;
                    break;
            }
            updateTransform();
        });

        document.addEventListener('wheel', (event) => {
            if (event.deltaY < 0) {
                if (posY < step)
                posY += step; // 向上滚动
            } else {
                if (posY > -step)
                posY -= step; // 向下滚动
            }
            updateTransform();
        });

        // 初始设置窗口大小
        updateWindowDimensions();
    </script>
</body>
</html>
